import React from 'react'
import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import SignInPage from './SignInPage';
import SignUpPage from './Signuppage';

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/signup">
            <SignUpPage />
          </Route>
          <Route path="/">
            <SignInPage />
          </Route>
        </Switch>
      </div>
    </Router>

  );
}

export default App;
